          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
          <div className="bubble" />
        </div>
      </div>   
      <div className="middle-container">
        <div className="profile">
          <p id="p1"><br></br><br></br>... also, i design things.</p> 
          <img className="midlogo" src={ca2} alt="ca2" />
          <img className="midlogo" src={heicoders} alt="heicoders" />
          <img className="midlogo" src={reunion} alt="reunion" />
          <img className="midlogoend" src={scis} alt="scis" />
        </div>
      </div>

    </div>
    );
  }
}

export default App;
